import React,{useState} from 'react';
import './App.css';
import Card from './Card'

function Cards(props) {
    mapdata=props.data
    function cardsRender(item)
    {
        return(
        <Card key ={item.FName} name={item.FName} address={item.Address}/>
        )
    } 
    return (
        <div className="App">
        {mapdata.map(cardsRender)}
        </div>
    );
    }

export default Cards;
